import{_ as s,y as a,S as o,M as n}from"./chunks/framework.a6902a73.js";const h=JSON.parse('{"title":"坐标转换","description":"","frontmatter":{},"headers":[],"relativePath":"src/functions/transform/coordTransform.md","filePath":"src/functions/transform/coordTransform.md"}'),l={name:"src/functions/transform/coordTransform.md"},e=n('<h1 id="坐标转换" tabindex="-1">坐标转换 <a class="header-anchor" href="#坐标转换" aria-label="Permalink to &quot;坐标转换&quot;">​</a></h1><p>提供百度坐标（BD-09）、国测局坐标（火星坐标，GCJ-02）、和 WGS-84 坐标系之间的转换</p><h3 id="地球坐标-wgs-84" tabindex="-1">地球坐标 (WGS-84) <a class="header-anchor" href="#地球坐标-wgs-84" aria-label="Permalink to &quot;地球坐标 (WGS-84)&quot;">​</a></h3><p>地球坐标称为<code>WGS84</code>是为GPS全球定位系统建立的坐标系统。它是一种<strong>国际标准</strong>，从GPS设备中获取到的坐标都是<code>WGS84</code>，国际地图提供的也是该坐标系统。比如谷歌地图，<code>cesium</code>等地图中使用的都是<code>WGS84</code>。</p><h3 id="火星坐标-gcj-02" tabindex="-1">火星坐标 (GCJ-02) <a class="header-anchor" href="#火星坐标-gcj-02" aria-label="Permalink to &quot;火星坐标 (GCJ-02)&quot;">​</a></h3><p>火星坐标系统也叫做国测局坐标系统，简称<code>GCJ-02</code>，它是一种<strong>中国标准</strong>的坐标系，是经过加密的，国行的设备获取到的坐标都是火星坐标，并且国内的地图产品也都是使用的火星坐标，这就是为什么获取到的<code>GPS</code>坐标叠加在<code>百度地图</code>，<code>高德地图</code>等地图上时会出现偏移的情况。</p><h3 id="百度坐标-bd-09" tabindex="-1">百度坐标 (BD-09) <a class="header-anchor" href="#百度坐标-bd-09" aria-label="Permalink to &quot;百度坐标 (BD-09)&quot;">​</a></h3><p>火星坐标加密也就算了，百度又在火星坐标的基础上进行二次加密，又形成了一套<code>百度标准</code>。当百度地图SDK获取到坐标时，叠加在其它厂商的地图上又会有偏移。</p><p><strong>使用：</strong></p><div class="language-js"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#676E95;font-style:italic;">// 按需引入需要的转换函数</span></span>\n<span class="line"><span style="color:#89DDFF;font-style:italic;">import</span><span style="color:#BABED8;"> </span><span style="color:#89DDFF;">{</span><span style="color:#F07178;"> </span><span style="color:#BABED8;">bd09Togcj02</span><span style="color:#F07178;"> </span><span style="color:#89DDFF;">}</span><span style="color:#BABED8;"> </span><span style="color:#89DDFF;font-style:italic;">from</span><span style="color:#BABED8;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">gmap-ol</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">;</span></span></code></pre></div><h2 id="bd-09-转换为-gcj-02" tabindex="-1"><code>BD-09</code> 转换为 <code>GCJ-02</code> <a class="header-anchor" href="#bd-09-转换为-gcj-02" aria-label="Permalink to &quot;`BD-09` 转换为 `GCJ-02`&quot;">​</a></h2><div class="language-js"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#C792EA;">const</span><span style="color:#BABED8;"> bd09togcj02 </span><span style="color:#89DDFF;">=</span><span style="color:#BABED8;"> </span><span style="color:#82AAFF;">bd09Togcj02</span><span style="color:#BABED8;">(</span><span style="color:#F78C6C;">116.404</span><span style="color:#89DDFF;">,</span><span style="color:#BABED8;"> </span><span style="color:#F78C6C;">39.915</span><span style="color:#BABED8;">)</span><span style="color:#89DDFF;">;</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#676E95;font-style:italic;">// bd09togcj02: [116.39762729119315, 39.90865673957631]</span></span></code></pre></div><h2 id="gcj-02-转换为-bd-09" tabindex="-1"><code>GCJ-02</code> 转换为 <code>BD-09</code> <a class="header-anchor" href="#gcj-02-转换为-bd-09" aria-label="Permalink to &quot;`GCJ-02` 转换为 `BD-09`&quot;">​</a></h2><div class="language-js"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#C792EA;">const</span><span style="color:#BABED8;"> gcj02tobd09 </span><span style="color:#89DDFF;">=</span><span style="color:#BABED8;"> </span><span style="color:#82AAFF;">gcj02Tobd09</span><span style="color:#BABED8;">(</span><span style="color:#F78C6C;">116.404</span><span style="color:#89DDFF;">,</span><span style="color:#BABED8;"> </span><span style="color:#F78C6C;">39.915</span><span style="color:#BABED8;">)</span><span style="color:#89DDFF;">;</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#676E95;font-style:italic;">// gcj02tobd09: [116.41036949371029, 39.92133699351021]</span></span></code></pre></div><h2 id="wgs-84-转换为-gcj-02" tabindex="-1"><code>WGS-84</code> 转换为 <code>GCJ-02</code> <a class="header-anchor" href="#wgs-84-转换为-gcj-02" aria-label="Permalink to &quot;`WGS-84` 转换为 `GCJ-02`&quot;">​</a></h2><div class="language-js"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#C792EA;">const</span><span style="color:#BABED8;"> wgs84togcj02 </span><span style="color:#89DDFF;">=</span><span style="color:#BABED8;"> </span><span style="color:#82AAFF;">wgs84Togcj02</span><span style="color:#BABED8;">(</span><span style="color:#F78C6C;">116.404</span><span style="color:#89DDFF;">,</span><span style="color:#BABED8;"> </span><span style="color:#F78C6C;">39.915</span><span style="color:#BABED8;">)</span><span style="color:#89DDFF;">;</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#676E95;font-style:italic;">// wgs84togcj02: [116.41024449916938, 39.91640428150164]</span></span></code></pre></div><h2 id="gcj-02-转换为-wgs-84" tabindex="-1"><code>GCJ-02</code> 转换为 <code>WGS-84</code> <a class="header-anchor" href="#gcj-02-转换为-wgs-84" aria-label="Permalink to &quot;`GCJ-02` 转换为 `WGS-84`&quot;">​</a></h2><div class="language-js"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#C792EA;">const</span><span style="color:#BABED8;"> gcj02towgs84 </span><span style="color:#89DDFF;">=</span><span style="color:#BABED8;"> </span><span style="color:#82AAFF;">gcj02Towgs84</span><span style="color:#BABED8;">(</span><span style="color:#F78C6C;">116.404</span><span style="color:#89DDFF;">,</span><span style="color:#BABED8;"> </span><span style="color:#F78C6C;">39.915</span><span style="color:#BABED8;">)</span><span style="color:#89DDFF;">;</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#676E95;font-style:italic;">// gcj02towgs84: [116.39775550083061, 39.91359571849836]</span></span></code></pre></div><h2 id="web墨卡托-转换为-wgs-84" tabindex="-1"><code>Web墨卡托</code> 转换为 <code>WGS-84</code> <a class="header-anchor" href="#web墨卡托-转换为-wgs-84" aria-label="Permalink to &quot;`Web墨卡托` 转换为 `WGS-84`&quot;">​</a></h2><div class="language-js"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#C792EA;">const</span><span style="color:#BABED8;"> mercator </span><span style="color:#89DDFF;">=</span><span style="color:#BABED8;"> </span><span style="color:#82AAFF;">mercatorTowgs84</span><span style="color:#BABED8;">(</span><span style="color:#F78C6C;">12607101.238338</span><span style="color:#89DDFF;">,</span><span style="color:#BABED8;"> </span><span style="color:#F78C6C;">2648567.8723786</span><span style="color:#BABED8;">)</span><span style="color:#89DDFF;">;</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#676E95;font-style:italic;">// mercator: [113.25151732417645, 23.136776742415808]</span></span></code></pre></div><h2 id="wgs-84-转换为-web墨卡托" tabindex="-1"><code>WGS-84</code> 转换为 <code>Web墨卡托</code> <a class="header-anchor" href="#wgs-84-转换为-web墨卡托" aria-label="Permalink to &quot;`WGS-84` 转换为 `Web墨卡托`&quot;">​</a></h2><div class="language-js"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#C792EA;">const</span><span style="color:#BABED8;"> lonlat </span><span style="color:#89DDFF;">=</span><span style="color:#BABED8;"> </span><span style="color:#82AAFF;">wgs84ToMercator</span><span style="color:#BABED8;">(</span><span style="color:#F78C6C;">116.404</span><span style="color:#89DDFF;">,</span><span style="color:#BABED8;"> </span><span style="color:#F78C6C;">39.915</span><span style="color:#BABED8;">)</span><span style="color:#89DDFF;">;</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#676E95;font-style:italic;">// lonlat: [12958034.004496444, 4853597.987624213]</span></span></code></pre></div>',22),p=[e];function c(t,r,i,d,y,D){return a(),o("div",null,p)}const F=s(l,[["render",c]]);export{h as __pageData,F as default};
